mapper.select:
select 

from GLI_VCHR
where STACID = #{stacid,jdbcType=DECIMAL}
  and SYSTID = #{systid,jdbcType=CHAR}
  and TRANDT = #{trandt,jdbcType=CHAR}
  and TRANSQ = #{transq,jdbcType=VARCHAR}
  and VCHRSQ = #{vchrsq,jdbcType=VARCHAR}

mapper.delete:
delete from GLI_VCHR
where STACID = #{stacid,jdbcType=DECIMAL}
  and SYSTID = #{systid,jdbcType=CHAR}
  and TRANDT = #{trandt,jdbcType=CHAR}
  and TRANSQ = #{transq,jdbcType=VARCHAR}
  and VCHRSQ = #{vchrsq,jdbcType=VARCHAR}
